var Ons = require('onsenui');
var ROns = require('react-onsenui');

export default class extends React.Component {
    constructor(){
      super();
    }
  
    render(){
      return (
    <ROns.Splitter>
    <ROns.SplitterSide
      mode={"collapse"}>
      <ROns.Page>sdas</ROns.Page>
    </ROns.SplitterSide>

    <ROns.SplitterContent>
      <ROns.Page>
          <UIView />
      </ROns.Page>
    </ROns.SplitterContent>

    </ROns.Splitter>
      );
    }
  }
